import ExpensiveItem from './ExpensiveItem'
import './Expenses.css'
import NewExpense from '../NewExpense/NewExpense'
const Expenses = (props) => {
    const addExpressHandler = (expense) =>{
        const newExpenses = {
          ...expense
        }
        
      }
    return(
        <div>
            <NewExpense onAddExpense={addExpressHandler}/>
            <div className="expenses">
                <ExpensiveItem title="Bag" price="150.25" date={new Date(2021,5,12)}/>
                <ExpensiveItem title="Car insurance" price="520.25" date={new Date(2021,4,27)}/>
                <ExpensiveItem title="Inventory" price="8000.00" date={new Date(2021,3,25)}/>
            
            </div>
        </div>
    );
}
export default Expenses;
